import React, { useState, useCallback } from 'react';
import { Card, Form, Button, Alert, Nav } from 'react-bootstrap';
import ChallengeInterface from '../components/ChallengeInterface';
import challengeData from '../challengeData';

const WebExploitationChallenge1 = () => {
  const [currentPage, setCurrentPage] = useState('login');
  const [theme, setTheme] = useState('light');
  const [loginInput, setLoginInput] = useState('');
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [uploadedFile, setUploadedFile] = useState(null);
  const [showFlag, setShowFlag] = useState(false);

  const challenge = challengeData.webExploitation.find(c => c.id === 'web3');

  const checkCredentials = useCallback((input) => {
    let query = `SELECT * FROM users WHERE username = '${input}'`;
    console.log("Executed query:", query);
    return input.includes("' OR '1'='1");
  }, []);

  const handleLogin = useCallback((e) => {
    e.preventDefault();
    if (checkCredentials(loginInput)) {
      setIsLoggedIn(true);
      setCurrentPage('upload');
    } else {
      alert('Invalid login');
    }
  }, [loginInput, checkCredentials]);

  const handleFileUpload = useCallback((e) => {
    const file = e.target.files[0];
    if (file && (file.name.endsWith('.php2') || file.name.endsWith('.php3'))) {
      setUploadedFile(file);
    } else {
      alert('Invalid file type. Please upload a .php2 or .php3 file.');
    }
  }, []);

  const handleFileSubmission = useCallback(() => {
    if (uploadedFile) {
      setShowFlag(true);
    }
  }, [uploadedFile]);

  const getCurrentUrl = () => {
    const baseUrl = "https://phantom.ctf/";
    if (currentPage === 'login') {
      return theme === 'light' ? baseUrl + "login.php" : baseUrl + "nigol.php";
    }
    return baseUrl + "upload.php";
  };

  const LoginPage = () => (
    <div>
      <div className="mb-3 p-2 bg-light border rounded">
        <strong>Current URL:</strong> {getCurrentUrl()}
      </div>
      <Nav variant="tabs" className="mb-3">
        <Nav.Item>
          <Nav.Link active={theme === 'light'} onClick={() => setTheme('light')}>Light Theme</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link active={theme === 'dark'} onClick={() => setTheme('dark')}>Dark Theme</Nav.Link>
        </Nav.Item>
      </Nav>
      <Form onSubmit={handleLogin}>
        <Form.Group className="mb-3">
          <Form.Label>Login:</Form.Label>
          <Form.Control 
            type="text" 
            value={loginInput}
            onChange={(e) => setLoginInput(e.target.value)}
            placeholder="Enter username or SQL injection"
          />
        </Form.Group>
        <Button variant="primary" type="submit">
          Login
        </Button>
      </Form>
    </div>
  );

  const UploadPage = () => (
    <div>
      <div className="mb-3 p-2 bg-light border rounded">
        <strong>Current URL:</strong> {getCurrentUrl()}
      </div>
      <h4>File Upload</h4>
      <Form.Group className="mb-3">
        <Form.Label>Upload PHP File (.php2 or .php3 only):</Form.Label>
        <Form.Control 
          type="file" 
          onChange={handleFileUpload}
          accept=".php2,.php3"
        />
      </Form.Group>
      <Button variant="primary" onClick={handleFileSubmission} disabled={!uploadedFile}>
        Submit File
      </Button>
      {showFlag && (
        <Alert variant="success" className="mt-3">
          Congratulations! You've successfully exploited both vulnerabilities. The flag is: {challenge.flag}
        </Alert>
      )}
    </div>
  );

  return (
    <ChallengeInterface challenge={challenge}>
      <Card className="mt-4">
        <Card.Body>
          <Card.Title>{challenge.title}</Card.Title>
          <Card.Text>{challenge.description}</Card.Text>
          <Alert variant="info">
            <strong>Hint:</strong> {challenge.hint}
          </Alert>

          {isLoggedIn ? <UploadPage /> : <LoginPage />}

        </Card.Body>
      </Card>
    </ChallengeInterface>
  );
};

export default WebExploitationChallenge1;
